import "./App.css";
import { BrowserRouter, Route, Routes } from "react-router-dom";

import TripRoute from "./pages/TripRoute";
import CheckInfo from "./pages/CheckInfo";

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <Routes>
          <Route path="/" element={<TripRoute />}></Route>
          <Route path="/checkinfo" element={<CheckInfo />}></Route>
        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
